description:
En man och en kvinna vaknar far att finna sig vara fangade 
i en kallare av en seriemordare. Allt eftersom deras kidnappare
driver dem psykiskt tokiga. Gar sanningen om deras hemska
belagenhet upp for dem, och de maste halla fast vid varandra -
om de skall lyckas ta sig darifran levande...
